BEGIN TRANSACTION;
CREATE TABLE current_stock (
            id INTEGER PRIMARY KEY,
            sku TEXT NOT NULL,
            warehouse TEXT NOT NULL,
            quantity REAL NOT NULL,
            last_updated TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
            UNIQUE(sku, warehouse)
        );
CREATE TABLE orders (
                id INTEGER PRIMARY KEY,
                order_number TEXT NOT NULL,
                sku TEXT NOT NULL,
                quantity REAL NOT NULL,
                warehouse TEXT NOT NULL,
                booking_date TEXT NOT NULL,
                reference_id TEXT UNIQUE NOT NULL,
                created_at TEXT DEFAULT CURRENT_TIMESTAMP
            );
CREATE TABLE products (
            id INTEGER PRIMARY KEY,
            sku TEXT UNIQUE NOT NULL,
            description TEXT,
            created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
        );
CREATE TABLE sales (
            id INTEGER PRIMARY KEY,
            sku TEXT NOT NULL,
            quantity REAL NOT NULL,
            sale_date DATE NOT NULL,
            warehouse TEXT,
            order_number TEXT,
            created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
        );
CREATE TABLE stock_levels (
                    id INTEGER PRIMARY KEY,
                    sku TEXT NOT NULL,
                    location TEXT NOT NULL,
                    on_hand DECIMAL NOT NULL DEFAULT 0,
                    allocated DECIMAL NOT NULL DEFAULT 0,
                    available DECIMAL NOT NULL DEFAULT 0,
                    last_updated TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
                    UNIQUE(sku, location)
                );
CREATE TABLE sync_state (
                id INTEGER PRIMARY KEY,
                sync_type TEXT UNIQUE NOT NULL,
                last_sync_timestamp TEXT,
                last_sync_success BOOLEAN DEFAULT TRUE,
                updated_at TEXT DEFAULT CURRENT_TIMESTAMP
            );
CREATE TABLE warehouses (
                id INTEGER PRIMARY KEY,
                code TEXT UNIQUE NOT NULL,
                name TEXT,
                region TEXT
            );
CREATE INDEX idx_orders_sku ON orders(sku);
CREATE INDEX idx_orders_date ON orders(booking_date);
CREATE INDEX idx_orders_warehouse ON orders(warehouse);
CREATE INDEX idx_orders_reference ON orders(reference_id);
COMMIT;
